  render() {
    return (
      <div className="how-I-do-it">
        <div className='how-I-do-it__text'> 
          <h4  className='how-I-do-it__text-small-title'> What I do </h4>
          <h2  className='how-I-do-it__text-big-title'> Hi, My name is Vasilis Georgoudis, </h2>
          <h2  className='how-I-do-it__text-big-title'> and Iâ€™m a Web Developer based in Greece. </h2>
          <div  className = 'how-I-do-it__text-paragraph'>
            <p> Lorem ipsum dolor sit amet, consectetur adipiscing elit,</p>
            <p> sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. </p>
            <p> Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris </p>
          </div>
        </div>

        <img src={image} className="how-I-do-it__picture"/>
      </div>
    );
  }
}

export default HowIdoIt;
